site.headStyle:
body .editable-style.column-section.container-element {
    padding: 0;
    margin: 0;
}
/* section takes all width */
div.column-section {
  width: 100%;
}
div.column-section > a {
  width: 100%;
}
@media (min-width:481px) {
  .silex-editor div.column-section {
    /* leave space to drop, only in the editor */
    padding: 50px 0;
  }
  div.column-section > a {
    /* 3 elements per line */
    width: 33.333%;
  }
}
.open-jobs {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 400;
  font-size: 56px;
  line-height: 56px;
  /* identical to box height, or 100% */


  color: #000000;

  mix-blend-mode: normal;
}
.open-jobs-text {
  font-family: 'Mulish';
  font-style: normal;
  font-weight: 300;
  font-size: 18px;
  line-height: 30px;
  /* or 167% */

  text-align: center;

  color: #7D7987;

  mix-blend-mode: normal;
}

.job-card {
  box-shadow: 10px 40px 50px rgba(229, 233, 246, 0.4);
  border-radius: 20px;
}
.job-card-title {
  font-family: 'Roboto';
  font-style: normal;
  font-weight: 700;
  font-size: 24px;
  line-height: 150%;
  /* identical to box height, or 36px */


  /* gray/900 */

  color: #18181B;
}
.job-card-rate {
  font-family: 'Amazon Ember';
  font-style: normal;
  font-weight: 400;
  font-size: 24px;
  line-height: 24px;
  /* identical to box height, or 100% */

  letter-spacing: -0.5px;

  color: #3F3F46;
}
.job-card-tags {
  font-family: 'Amazon Ember';
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 150%;
  /* identical to box height, or 24px */


  /* gray/700 */

  color: #3F3F46;
}
.job-card-skill-card {
  border-radius: 7px;
}
.job-card-skill-card-text {
  font-family: 'Amazon Ember';
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 22px;
  /* identical to box height, or 160% */


  color: #1F1F1F;
}
